export default function Practice(props) {
  const [form, setForm] = React.useState({
    firstName: '',
    lastName: ''
  });

  const removeOutline = ($) => {
    $.target.style.outlineColor = 'lightblue';
  };

  const handleChange = ($) => $.target.id === 'firstName' ? setFirstName($.target.value) : setLastName($.target.value);

  const handleClick = ($) => $.preventDefault();

  console.log('First name is ' + firstName);
  console.log('Last name is ' + lastName);
 
  return (
    <form onClick={ handleClick }>
        <input type="text" placeholder="First Name" id='firstName' onFocus={ removeOutline } onChange={ handleChange }>
        </input>
        <br />
        <br />
        <input type="text" placeholder="Last Name" id='lastName' onFocus={ removeOutline } onChange={ handleChange }>
        </input>
    </form>
  );
}
